import './index.css';

function Navbar() {

    const theme = true;
  return (
    <>
        <div className="iplant-nav" style={{
                color: "black",
                textAlign: theme === true ? "right" : "left",
                padding: "32px",
                borderBottom: "2px solid black ",
        }}>
            <h1>iPlant</h1>
        </div>
    </>
  )
}

export default Navbar
